import axios from 'axios'
import { randomBytes } from 'crypto'
import {
  cisFemaleAdult34 as her,
  cisMaleAdult42 as him,
} from '../../../packages/models/src/index.mjs'

const sets = { her, him }
export const api = new restClient(`http://localhost:3000`)

// Store holds test accounts
export const store = await setup()

// Authentication data
export const auth = {
  jwt: { headers: { Authorization: `Bearer ${store.account.token}` } },
  altjwt: { headers: { Authorization: `Bearer ${store.altaccount.token}` } },
  key: {
    headers: { Authorization: basicAuth(store.account.apikey.key, store.account.apikey.secret) },
  },
  altkey: {
    headers: {
      Authorization: basicAuth(store.altaccount.apikey.key, store.altaccount.apikey.secret),
    },
  },
  basic: ({ key, secret }) => ({ headers: { Authorization: basicAuth(key, secret) } }),
}

function basicAuth(u, p) {
  return 'Basic ' + Buffer.from(`${u}:${p}`).toString('base64')
}

/*
 * Generates a random string
 *
 * This is not used in anything cryptographic. It is only used as a temporary
 * username to avoid username collisions or to generate (long) API key secrets
 * and as scratch codes for MFA
 */
export function randomString(bytes = 8) {
  return randomBytes(bytes).toString('hex')
}

/*
 * General purpose method to call an HTTP endpoint
 *
 * @param {object} options - The Axios options object (includes, url, method, and optional data)
 * @return {response} object - Either the result parse as JSON, the raw result, or false in case of trouble
 */
async function http(options) {
  /*
   * Send the request
   */
  let response
  try {
    response = await axios(options)
  } catch (err) {
    //console.log(err)
    return [err.response?.status, err.response?.data, err]
  }

  return [response?.status || false, response?.data || false, response]
}

/*
 * General purpose client for a REST API, uses Axios
 *
 * @param {string} api - The API root URL
 * @param {object} options - Any optional Axios options to apply to all requests
 * @return {object] client - The REST client
 */
function restClient(api, options = {}) {
  /*
   * Merge default and custom options
   */
  const defaultOptions = {
    baseURL: api,
    method: 'GET',
    headers: {},
    data: undefined,
    timeout: 1500,
    ...options,
  }
  if (api.toLowerCase().slice(0, 6) === 'https:') {
    // Needed for certificate issues
    defaultOptions.httpsAgent = new https.Agent({ rejectUnauthorized: false })
  }
  const mergeOptions = (custom) => ({
    ...defaultOptions,
    ...custom,
    headers: {
      ...defaultOptions.headers,
      ...(custom.headers || {}),
    },
  })

  return {
    delete: async (url, options = {}) => http(mergeOptions({ ...options, method: 'DELETE', url })),
    get: async (url, options = {}) => http(mergeOptions({ ...options, url })),
    patch: async (url, data, options = {}) =>
      http(mergeOptions({ ...options, method: 'PATCH', data, url })),
    post: async (url, data, options = {}) =>
      http(mergeOptions({ ...options, method: 'POST', data, url })),
    put: async (url, data, options = {}) =>
      http(mergeOptions({ ...options, method: 'PUT', data, url })),
  }
}

async function setup() {
  // Initial store contents
  const store = {
    randomString,
    account: {
      email: `test_${randomString()}@freesewing.dev`,
      password: randomString(),
      sets: {},
    },
    altaccount: {
      email: `test_${randomString()}@freesewing.dev`,
      password: randomString(),
      sets: {},
    },
  }

  for (const acc of ['account', 'altaccount']) {
    // Get confirmation ID
    let status, data
    try {
      ;[status, data] = await api.post(`/signup`, {
        email: store[acc].email,
        test: true,
        role: 'curator',
      })
    } catch (err) {
      console.log('Failed at first setup request', err)
      process.exit()
    }
    store[acc].confirmation = data.confirmation

    // Confirm account
    try {
      ;[status, data] = await api.post(`/confirm/signup/${store[acc].confirmation}`, {
        consent: 1,
      })
    } catch (err) {
      console.log('Failed at account confirmation request', err)
      process.exit()
    }
    store[acc].token = data.token
    store[acc].username = data.account.username
    store[acc].id = data.account.id

    // Create API key
    try {
      ;[status, data] = await api.post(
        `/apikeys/jwt`,
        {
          name: 'Test API key',
          level: 5,
          expiresIn: 60,
        },
        {
          headers: {
            authorization: `Bearer ${store[acc].token}`,
          },
        }
      )
    } catch (err) {
      console.log('Failed at API key creation request', err)
      process.exit()
    }
    store[acc].apikey = data.apikey

    // Create sets key
    for (const name in sets) {
      try {
        ;[status, data] = await api.post(
          `/sets/jwt`,
          {
            name: `This is ${name} name`,
            notes: `These are ${name} notes`,
            measies: sets[name],
          },
          {
            headers: {
              authorization: `Bearer ${store[acc].token}`,
            },
          }
        )
      } catch (err) {
        console.log('Failed at API key creation request', err)
        process.exit()
      }
      store[acc].sets[name] = data.set
    }
  }

  return store
}

